import { Route, Router, Routes } from 'react-router-dom';
import './App.css';
import './Assets/css/front.css'
import Nav from './Components'

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='' element={<Nav/>}/>
        </Routes>
      </Router>


    </div>
  );
}

export default App;
